import UserContext from "./contexts/UserContext";
import CookieManager from "./cookies/CookieManager";
import Config from "./config/Config";
import './App.css';


const App = () => {
    return(
        <Router>
                <CookieManager>
                    <UserContext>
            <Config>
                        {/* <Route path="/" component={MainContentArea}/> */}
                        <MainContentArea/>
            </Config>
                    </UserContext>
                </CookieManager>
        </Router>
    );
}

export default App;
